import './Register.css'

import React from "react";

import AuthPage from "../AuthPage/AuthPage"

function Register({ movie }) {
    return (
        <div className='register'>
            <AuthPage formName='register' title='Регистрация' buttonText='Зарегистрироваться'>
                <input name="Email" type="email" className="popup__input popup__input_type_login" id="email" placeholder="Email" minLength="6" maxLength="40" required />
